<?php

/* @autogenerated */
declare(strict_types=1);

namespace Civi\Lughauth\Shared\Exception;

/**
 * Exception thrown when a uniqueness constraint is violated.
 */
class NotUniqueException extends \RuntimeException
{
    /**
     * Constructs the exception with the message from a previous exception.
     *
     * @param \Exception $ex The previous exception containing the message.
     */
    public function __construct(\Exception $ex)
    {
        parent::__construct($ex->getMessage(), $ex->getCode(), $ex);
    }
}
